if mibBuilder.loadTexts: hpnicfVsanDmFabricChangeNotify.setDescription('This event will be triggered if a switch sends or receives a Build Fabric (BF) or a Reconfigure Fabric (RCF) message in a VSAN. The conditions a switch can receive or send a BF or a RCF are listed as follows: 1. Two isolated fabrics in a VSAN merge into one fabric. If the Domain ID lists do not overlap, the sent or received message is BF, other cases, it is RCF. 2. If an upstream principal link which connects to principal switch and other switches become disconnected, the sent or received message is BF. 3. A BF or RCF process is triggered manually by configuration. The notification contains the index of the VSAN in which a BF or a RCF was sent or received.')
